import React, {useState} from 'react';
import ReactDOM from 'react-dom';
import './index.css'
import ThePeople from './test.jsx';
import contact from './contacts'
import * as cal from './Heading'

function createCard(contact) {
  return (
    <cal.default 
    id = {contact.id}
    name = {contact.name}
    tel = {contact.tel}
    email = {contact.email} />
    )
}

function App() {
  const [items, setItems] = useState([]);
  contact.map(heading => {
    return (
    <cal.default 
    id = {heading.id}
    name = {heading.name}
    tel = {heading.tel}
    email = {heading.email} />
    )
 })}


 
export default App;
